TUTORIAL10 = "Můžeš umístit batohy do prázdných míst na opasku v pravém dolním rohu vedle batohu, a kliknutím je otevřeš.";
TUTORIAL17 = "Můžeš odpovědět hráči pomocí zmáčknutí klávesy R a napsáním zprávy, nebo napsáním /tell <jeho_jméno> a zprávy.";
TUTORIAL14 = "You can go to your trainer in your the starting area and learn a new skill.  You may have to search around a little to find your trainer.";
TUTORIAL7 = "Klikni pravým tlačítkem pro zobrazení předmětů z těla. Poté můžeš kliknout na předmět pro jeho získání a přesunutí do batohu.";
TUTORIAL18 = "Můžeš pozvat ostatní hráče do skupiny kliknutím pravým tlačítkem myši na jeho portrét a vybráním možnosti pozvat v menu.";
TUTORIAL35 = "Klikl jsi na velitele vzdušné letky, který učí zvířata létat s pasažéry z jednoho místa na druhé. Za minimální poplatek můžeš rychle cestovat na místa, kde jsi již byl a střetl se s jinými veliteli. Když objevíš nové město vyhledej velitele vzdušné letky pro snadnější návrat.";
TUTORIAL50 = "You now have a keyring to hold your dungeon keys. This keyring appears to the left of your bags on your action bar. The keyring can only store permanent keys.";
TUTORIAL23 = "Můžeš poslat zprávu zmáčknutím klávesy enter a napsáním zprávy. Ostatní hráči v blízkosti zprávu uvidí.";
TUTORIAL21 = "Můžeš otevřít seznam výprav pro prohlížení výprav kliknutím na zlatý kalich dole uprostřed obrazovky.";
TUTORIAL25 = "Nyní jsi duch. Můžeš se vrátit k životu buď nalezením svého těla, nebo oživení u nejbližšího léčitele duchů. Tvé tělo se zobrazuje na minimapce jako ikona, minimapa je nahoře vpravo.";
TUTORIAL15 = "Můžeš přesunout kouzla a schopnosti do akčního panelu otevřením knihy kouzel kliknutím na ikonku dole uprostřed obrazovky a přetažením ikon schopností. Také můžeš použít schopnost v knize kouzel kliknutím na ikonu.";
TUTORIAL30 = "Nyní jsi začal odpočívat, označeno žlutým pozadím na tvém portrétu. Čas strávený odpočíváním nebo odhlášením ti dává dočasný bonus na zkušenosti získané ze zabíjení bossů. Možná budeš potřebovat najít hospodského a nastavit si krbovou pro rychlý návrat domů.";
TUTORIAL6 = "Můžeš kouzlit kouzla a používat schopnosti v boji pomocí tlačítek vlevo dole na akčním panelu.";
TUTORIAL2 = "Můžeš se pohybovat s klávesy ASDW, s šipky na klávesnici nebo držením obou tlačítek myši.";
TUTORIAL37 = "Jeden z tvých předmětů je zlomen! Panáček pod minimapou signalizuje tento předmět červenou barvou. Můžeš tento předmět opravit u opraváře ve městě. Dokud to neprovedeš nebudeš mít výhody z tohoto předmětu.";
TUTORIAL39 = "Možná budeš chtít pozvat ostatní hráče do týmu pro snadnější zničení nepřátel. Mnoho těžkých výprav může být splněno ve skupině rychleji. Navíc, skupina dostává bonus na získané zkušenosti, oproti jednotlivému hráči.";
TUTORIAL29 = "Když se potopíš uvidíš kolik ti zbývá vzduchu, když ti dojde vzduch začneš se topit.";
TUTORIAL1 = "Výpravy jsou označeny značkou vykřičníku nad hlavou. Získej výpravu přiblížením a pravým kliknutím na něj.";
TUTORIAL5 = "Vstoupil jsi do bojového módu kliknutím pravým tlačítkem myši na cíl a přesunutím do bojové vzdálenosti. Začneš automaticky bojovat s tvým protivníkem.";
TUTORIAL41 = "You have accepted an elite quest. Such quests are best undertaken in a group, for they will take you into areas inhabited by elite creatures. These creatures are significantly tougher than normal monsters; however, they are worth more experience. You can tell an elite creature by the golden dragon border around its portrait.";
TUTORIAL3 = "Můžeš otáčet pohledem tažením levým tlačítkem myši v herní oblasti. Můžeš otáčet postavou a pohledem ve stejný čas tažením pravým tlačítkem v herní oblasti.";
TUTORIAL44 = "Obdržel jsi střelnou zbraň. Pro použití se jí vybav, otevři knihu kouzel a přetáhni ikonu Střelby nebo Vrhací schopnosti do akčního panelu.";
TUTORIAL22 = "Když si oblíbíš některého hráče můžeš si jej umístit do seznamu přátel. Klikni na společenskou ikonu a přidej si ho.";
TUTORIAL13 = "Můžeš se naučit nový talent v okně talentů, otevřeš ho kliknutím na ikonku talentů v akčním panelu.";
TUTORIAL8 = "Předměty se přesunuly do tvého batohu. Můžeš kliknout na tlačítko batohu vpravo dole. Přesuň myš nad předmět pro informace o předmětu.";
TUTORIAL20 = "Pravým kliknutím na předmět u obchodníka ho koupíte jestli máte dost peněz. Dokud je otevřeno obchodování pravým kliknutím na předmět v batohu jej prodáte.";
TUTORIAL32 = "Jsi v boji s jiným hráčem. Dokud jsi zúčastněný v boji hráč proti hráči symbol tvojí aliance je zobrazen vedle tvého portrétu a může na tebe zaútočit jiný nepřátelský hráč.";
TUTORIAL4 = "Levým-kliknutím označíte číl a Pravým-kliknutím na něj zaútočíte.";
TUTORIAL46 = "You have joined a raid group: a group with an increased limit of 40 members.\n\n|cffff2020While in a raid group, you will not earn credit towards most non-raid quests by killing creatures or collecting items.|r";
TUTORIAL48 = "Nyní jsi ve frontě na vstup na bitevní pole. Můžeš zkontrolovat status pomocí ikonky u minimapy.";
TUTORIAL36 = "Opotřebení jedné z tvých věcí kleslo. Panáček pod minimapou signalizuje opotřebení jednotlivých věcí. Najdi opraváře ve městě pro zpravení tvých věcí.";
TUTORIAL33 = "Můžeš zmáčknout mezerník, aby jsi přiměl tvoji postavu vyskočit. Skákání vám může pomoci dostat se přes překážku, a může vám velmi nápomocná když máte potíže dostat se z vody na pevninu.";
TUTORIAL24 = "Můžeš se vybavit předměty otevřením okna postavy tlačítkem dole uprostřed obrazovky, a přetažením z batohu.";
TUTORIAL34 = "Splnil jsi první výpravu. Pro vyzvednutí odměny se vrať k postavě, která ti výpravu zadala. Když máš splněnu výpravu můžeš vidět na tvé minimapce místo, kde můžeš výpravu odevzdat.";
TUTORIAL16 = "Můžeš se podívat na reputaci u rozdílných skupin ve světě v okně postavy pod záložkou reputace.";
TUTORIAL47 = "Nyní čekáš na dotyk člena skupiny. Setkávací kámen je indikován bublinou u minimapky. Můžeš kliknout na indikátor pro opuštění fronty.";
TUTORIAL40 = "Naučil jsi se nové kouzlo! Klikni na tlačítko knihy kouzel dole uprostřed obrazovky. Klikni a táhni pro přesunutí kouzla nebo schopnosti do akčního panelu. Kniha kouzel je organizována podle kategorií, vybereš je pomocí záložek na pravém okraji knihy.";
TUTORIAL12 = "Můžeš pít pro rychlejší regeneraci many. Klikni na ikonu pití v akčním panelu v dolním konci obrazovky. Regenerace many se zastaví, když použiješ jinou schopnost nebo když začneš bojovat.";
TUTORIAL9 = "Klikni pravým tlačítkem myši pro použití. Můžeš přesunout použitelné předměty do akčního panelu pro rychlé použití.";
TUTORIAL38 = "Tvoje postava se může naučit pouze dvě profese, které ti dovolí vytvářet předměty. Pro zjištění více informací si promluv se stráži ve městě kde sídlí trenéři.";
TUTORIAL45 = "Nemůžeš střílet z luku, nebo zbraně bez munice. Pro zakoupení munice navštiv prodejce luků nebo pušek. Pro vybavení se střelivem klikni pravým tlačítkem.";
TUTORIAL19 = "To je opravdový člověk hrající za postavu. Můžeš mu napsat podle modrého jména nad jeho hlavou.";
TUTORIAL42 = "When you encounter something new, a help button will appear in the bottom center of your screen. Click the button for a brief explanation of how to interact with that part of the world. These hints will start with the basics and then progress to more advanced topics as you gain in experience.\n\nThank you for playing, and good luck in your adventures!";
TUTORIAL43 = "NPC s šedým '!' nad jeho hlavou tak to znamená že máš příliš malou úroveň na výpravu. Zkontroluj po dosáhnutí vyšší úrovně.";
TUTORIAL49 = "Nyní jsi pozván na připojení se do boje. Klikni na \"Připojit se do boje\" v okně, nebo v kontextovém menu ikony u minimapky.";
TUTORIAL28 = "Plavání je stejné jako běhání s rozdílem že se můžete potápět níž a nebo plavat k hladině držením pravého tlačítka myši a natočením směrem, kterým chcete plavat.";
TUTORIAL27 = "Pokud se ponoříte do hluboké vody zobrazí se vám kolik vzduchu vám zbývá. Pokud mám tento vzduch dojde začnete se topit.";
TUTORIAL26 = "Jsi odpočinutý. Odpočinek ti dá dočasný bonus na zkušenosti získané ze zabíjení monster.";
